import React from "react";
import ReactDOM from "react-dom";
import { BodyHomepage } from "./bodyHomePage/bodyHomepage";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import BodyMotor from "./dragster800rr_scs/dragster800rr_scs_body";
function Index(){
    return (
      <BrowserRouter>
        <div>
          <Switch>
            <Route path="/index" component={BodyHomepage} exact />
            <Route path="/home" component={BodyHomepage} exact />
            <Route path="/" component={BodyHomepage} exact />
            <Route path="/dragster800rrscs" component={BodyMotor} />
          </Switch>
        </div>
      </BrowserRouter>
    );
}
ReactDOM.render(<Index />, document.getElementById('body'));
